<script>
function svg_pan_zoom(){
saveOriginal();
if( /Android|webOS|iPhone|iPad|iPod|BlackBerry|IEMobile|Opera Mini/i.test(navigator.userAgent) ) {
} else {
(function(){
    window.zoom= svgPanZoom('#unifilar', {
      zoomEnabled: true,
      controlIconsEnabled: true,
      fit: true,
      center: true,
    });
})();
}
}
var head = document.querySelector('header');
if (head) {
var frag = document.createDocumentFragment();
var holder = document.createElement("input");
holder.setAttribute("list","telas");
holder.setAttribute("id","input_telas");
holder.setAttribute("onchange","quickTela('input_telas')");
holder.innerHTML = html;  //html definido em quick_telas.js
frag.appendChild(holder);
head.appendChild(frag);
}

function quickTela(listid) {
  var listObj = document.getElementById(listid);
  console.log(listObj.value);
  var datalist = listObj.list;
  for (var j = 0; j < datalist.options.length; j++) {
      if (listObj.value == datalist.options[j].value) {
          window.location.href = listObj.value;
          break;
      }
  }
     console.log("nao escolheu nenhuma tela");
}

[].forEach.call(document.querySelectorAll("[data-sage\\:tipo='Medida']"), function(item) {
  item.addEventListener("mouseenter", function() { barTip(this); }); });

function hideDivTip(){ // x - esconder div com o bartip dos limites
    var element = document.getElementById("divTip");
    element.classList.add("bartipHide");
    var showBut = document.getElementById("showButton");
    showBut.style.display="flex";
}
function showDivTip(){ // mostrar div com o bartip dos limites
    var element = document.getElementById("divTip");
    element.classList.remove("bartipHide");
    var showBut = document.getElementById("showButton");
    showBut.style.display="none";
}

var tooltip = document.querySelector(".svg-tooltip");
[].forEach.call(document.querySelectorAll("[data-sage\\:tipo]"), function(item) {
  
  item.addEventListener("mouseenter", function() {
    if (window.showTooltip && item.dataset.hasOwnProperty("sage:name"))  {
        tooltip.innerHTML = item.getAttribute("data-sage:name");
        tooltip.style.display = "block";
    }
  });
  
  item.addEventListener("mousemove", function(e) {
    let bb = item.getBoundingClientRect();
    let posy;
    if (item.tagName=="text") posy = bb.y + bb.height;
    else                      posy = e.clientY;
  	 tooltip.style.top =  posy + "px";
    tooltip.style.left = e.clientX + "px";
  });
  
  // when mouse leave hide the tooltip
  item.addEventListener("mouseleave", function(){
  	 tooltip.style.display = "none";
  });
});
window.showTooltip = false;
function showHideTooltip () {
   window.showTooltip = !window.showTooltip;
   let ttip = document.getElementById('tooltipButton');
   if (window.showTooltip)
      ttip.innerHTML = "<i class='fa fa-comment-slash'></i>"
   else
      ttip.innerHTML = "<i class='fa fa-comment'></i>"
}
</script>
